import logo from './logo.svg';
import './App.css';
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Jouster from './components/Jouster/Jouster';
function App() {
  return (
    <Router>  
      <Routes>
      <Route
        element={<Jouster />}
        path="jousting"

      />
      </Routes>
    </Router>
  );
}

export default App;
